import React from 'react';
import styled from "styled-components";

const Container = styled("p")`
padding:20px;
`;

const Title = styled("p")`
font-family: Open Sans;
font-style: normal;
font-weight: bold;
font-size: 14px;
line-height: 19px;
color: #444444;
`;

const VehicleList = () => {
    return (
        <>
        <Container>
        <Title>Select Vehicle</Title>
        </Container>

        </>
    );
}

export default VehicleList;
